import React from "react";

    function Mohammad() {
        return (
          <div>

            <h1>Mohammad Khan</h1>
        <h2>Bio</h2>
         <p>Senior (Fall '21) at SFSU aspiring to be a software engineer. </p>
         <p>
        Served as the Git Repo Master for the CSC 648 group project and in addition to learning many of the different
        technologies involved in this project, will be working on setting up and configuring the database with the AWS
        infrastructure for our web app.
        </p>

    <h2>Education</h2>
    <p>San Francisco State University, B.S. Computer Science, Dec 2021</p>

    <h2>Technical Skills</h2>
    <p>Java/Python/MySQL/JS/HTML5/CSS</p>


          </div>
        );
      };

      export default Mohammad;
